sameGuard :: Record -> Bool
sameGuard (_,_,i) = i <= 0

minutesAsleep :: [Record] -> [Int]
minutesAsleep [] = []
minutesAsleep ((_,(_,s),_):(_,(_,w),_):rs) = [s..w-1] ++ minutesAsleep rs

measureAsleep :: [Record] -> [(ID,[Int])]
measureAsleep [] = []
measureAsleep ((_,_,i):rs) = (i,minutesAsleep (takeWhile sameGuard rs)) : measureAsleep (dropWhile sameGuard rs)

combine :: [(ID,[Int])] -> [Int]
combine [] = []
combine (x:xs) = snd x ++ combine xs

sleepPerGuard :: [(ID,[Int])] -> [(ID,[Int])]
sleepPerGuard [] = []
sleepPerGuard rs = (i,combine (takeWhile (\(i',_) -> i' == i) rs)) : sleepPerGuard (dropWhile (\(i',_) -> i' == i) rs)
                   where i = fst (head rs)

accumulateSleeping :: [Int] -> [(Int,Int)]
accumulateSleeping xs = map (\ys -> (length ys,head ys)) (group xs')
        where xs' = sort xs

countMinutes :: [(ID,[Int])] -> [(ID,[(Int,Int)])]
countMinutes = map (\(i,ms) -> (i,accumulateSleeping ms))

bla ::[(ID, [(Int, Int)])]
bla = filter (\(_,xs) -> length xs > 0) (countMinutes (sleepPerGuard (sort (measureAsleep records))))

blabla :: [((Int, Int), ID)]
blabla = reverse (sort (map (\(i,xs) -> (head (reverse (sort xs)),i)) bla))

sol :: ((Int, Int), ID) -> Int
sol ((_,m),i) = m * i

puzzle_04_2 :: Int
puzzle_04_2 = sol (head blabla)